import base64
import hashlib
from Crypto.Cipher import ARC4 as rc4cipher

str='F\x00O\x009\x001\x001\x009\x005\x000\x00'
h = hashlib.md5()
h.update(str.encode())
key = h.hexdigest()
key = ''.join([i+'\x00' for i in key])
print(key)
#'71eaba91fb9106d4419f988a153218c0'

cipher = base64.b64decode(b"ydN8BXq16RE=")
cipher2 = base64.b64decode(b"")
print(cipher2)
def rc4_crypto(c, k):
    key = bytes(k, encoding='utf-8')
    enc = rc4cipher.new(key)
    res = enc.decrypt(c)
    return res

print(repr(rc4_crypto(cipher2, key)))


